+
+static inline uintptr_t align_down_uintptr(uintptr_t value, uintptr_t align)
+{
+    return value & ~(align - 1);
+}
+
+static inline uintptr_t align_up_uintptr(uintptr_t value, uintptr_t align)
+{
+    return (value + align - 1) & ~(align - 1);
+}
+
+static bool validate_header(const elf64_header_t *header)
+{
+    if (!header)
+    {
+        return false;
+    }
+    const uint8_t *ident = header->ident;
+    if (ident[0] != ELF_MAGIC_0 ||
+        ident[1] != ELF_MAGIC_1 ||
+        ident[2] != ELF_MAGIC_2 ||
+        ident[3] != ELF_MAGIC_3)
