+static bool build_user_stack(const char *const *argv,
+                             size_t argc,
+                             user_stack_image_t *out_stack)
+{
+    if (!out_stack)
+    {
+        return false;
+    }
+    uint8_t *buffer = (uint8_t *)malloc(USER_STACK_SIZE);
+    if (!buffer)
+    {
+        return false;
