+    memset(buffer, 0, USER_STACK_SIZE);
+
+    uintptr_t stack_base = USER_STACK_TOP - USER_STACK_SIZE;
+    size_t sp = USER_STACK_SIZE;
+
+    size_t total_strings = 0;
+    uintptr_t *arg_ptrs = NULL;
