+        size_t len = strlen(arg) + 1;
+        memcpy(buffer + strings_offset + cursor, arg, len);
+        arg_ptrs[i] = stack_base + strings_offset + cursor;
+        cursor += len;
+    }
+
+    sp = align_down_uintptr(sp, 16);
